var firebaseApp1=null;
var provider=null;

var Styles=[];
var Scripts=[];


class $Render{
    num=0;
    onLoad={};
    linkArray=[];
    constructor(fun,linkArray=null){
        this.linkArray=linkArray;
        this.onLoad=fun;
    }
    addScript(link){
        this.linkArray.push(link);
        return this;
    }
    addStyle(link){
        if(!Styles.find(x=>x==link))
        {
          var newSS=document.createElement('link');
          newSS.rel='stylesheet';
          newSS.href=link;
          document.getElementsByTagName("head")[0].appendChild(newSS);
          Styles.push(link);
        }
        return this;
    }
    Start()
    {
        if(this.linkArray.length!=0)
        {
            if(!Scripts.find(x=>x==this.linkArray[this.num]))
            {
                Scripts.push(this.linkArray[this.num]);
                let script=document.createElement('script');
                script.src=this.linkArray[this.num];
                script.onload = ()=> {
                    this.num++;
                   if(this.num<=this.linkArray.length-1)
                   {
                       this.Start();
                   }
                   else{
                       this.onLoad(true);
                   }
                };
                script.onerror=()=>{
                    this.num++;
                   if(this.num<=this.linkArray.length-1)
                   {
                       this.Start();
                   }
                   else{
                       this.onLoad(true);
                   }
                }
                document.getElementsByTagName("body")[0].appendChild(script);
            }
            else{
                this.num++;
                if(this.num<=this.linkArray.length-1)
                {
                    this.Start();
                }
                else{
                    this.onLoad(true);
                }
            }
        }
        else{
            if(this.onLoad)
            {
                setTimeout(() => {
                    this.onLoad(true);
                }, 1);
            }
        }
    }
}



let dragElement=(elmnt)=> {
    var pos1 = 0, pos2 = 0, pos3 = 0, pos4 = 0;
    if (elmnt.querySelector('#kiven-header')) {
      /* if present, the header is where you move the DIV from:*/
      elmnt.querySelector('#kiven-header').onmousedown = dragMouseDown;
    } else {
      /* otherwise, move the DIV from anywhere inside the DIV:*/
      elmnt.onmousedown = dragMouseDown;
    }

    function dragMouseDown(e) {
      elmnt.style.zIndex=9999999;
      document.querySelectorAll('.KFileManager').forEach(res=>{
          if(res.id != elmnt.id)
          {
            res.style.zIndex--;
          }
      })
      e = e || window.event;
      // get the mouse cursor position at startup:
      pos3 = e.clientX;
      pos4 = e.clientY;
      document.onmouseup = closeDragElement;
      // call a function whenever the cursor moves:
      document.onmousemove = elementDrag;
    }

    function elementDrag(e) {
      e = e || window.event;
      // calculate the new cursor position:
      pos1 = pos3 - e.clientX;
      pos2 = pos4 - e.clientY;
      pos3 = e.clientX;
      pos4 = e.clientY;
      // set the element's new position:
      elmnt.style.top = (elmnt.offsetTop - pos2) + "px";
      elmnt.style.left = (elmnt.offsetLeft - pos1) + "px";
    }

    function closeDragElement() {
      document.onmouseup = null;
      document.onmousemove = null;
    }
  }





